    render() {

      let title = "יצירת חשבון";
      const btnTxt = "עדכן"

      const user = new User();
      
      return (

          <>
            <UserInfoForm user={this.state.user} title={title} btnClick={this.update} btnTxt={btnTxt}/>
          </>

      )

    }
}

